U\"},\"subContentId\":\"33825852-9077-4e91-aeef-8feb82ee7c7f\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2- With respect to answer 1, how much energy (in kJ) should the hamster consume in one week to avoid losing weight?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b9e1b179-0de6-4cac-9005-73eefa41ac91\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3- Does it matter if the hamster eats all its daily amount of energy requirements in one meal only? Explain.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"32f29b68-b7be-4b59-9d3c-14cc3dd31c60\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4-The hamster was captured by a scientist and fed with a protein-only diet. Will the hamster have enough energy without eating carbohydrates or lipids?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"d5b19486-58a8-4f12-976b-7f792a40283c\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"The Hamster\",\"authors\":[],\"changes\":[],\"extraTitle\":\"The Hamster\"},\"subContentId\":\"4f652bb6-e263-4ba5-be6d-b0e76871fb1e\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1- The hamster's weight is 500 g (or 0.5 kg). If for every hour, he spends 5 kJ, so 5 kJ x 24h = 120 kJ per day.</p>\\n\\n<p>2- 7 days x120 kJ/day = 840 kJ/ week.</p>\\n\\n<p>3- No, it doesn't matter because as long as it gets the amount of its energy needs per day, it will survive.</p>\\n\\n<p>4- Yes, because just like carbohydrates and fats, proteins have enough energy and can be used by the body. However, carbohydrates are a better source of fast energy.</p>\\n\\n<p></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1ad4b1de-5a4a-4de8-941e-c87607b9fefd\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Elements of response\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Elements of response\"},\"subContentId\":\"d0a77f17-2440-4383-8ff5-30a013e0a9d4\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Problem 1\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem 1\"},\"subContentId\":\"1818f8b1-e3a7-4649-87c0-be25c9a1e9eb\"}},{\"content\":{\"params\":{\"taskDescription\":\"Problem 2\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4QhoRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAADqV6AAAnEAAOpXoAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAyMTowMzowNCAxMjo0NTozNQAAA6ABAAMAAAABAAEAAKACAAQAAAABAAAEr6ADAAQAAAABAAABewAAAAAAAAAGAQMAAwAAAAEABgAAARoABQAAAAEAAAEeARsABQAAAAEAAAEmASgAAwAAAAEAAgAAAgEABAAAAAEAAAEuAgIABAAAAAEAAAcyAAAAAAAAAEgAAAABAAAASAAAAAH/2P/tAAxBZG9iZV9DTQAB/+4ADkFkb2JlAGSAAAAAAf/bAIQADAgICAkIDAkJDBELCgsRFQ8MDA8VGBMTFRMTGBEMDAwMDAwRDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAENCwsNDg0QDg4QFA4ODhQUDg4ODhQRDAwMDAwREQwMDAwMDBEMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwM/8AA t+Y/m61kCwep/NV64EGuvz/ZQFwdB+asi5cC9H18f02qXwJJFbEeBsR4Gqfm8etSjI99/Zz/AOEXtX/0b4P/ANmQV8AdZ/8AWNX/AKtz/Mz9lfK/8s7d+Hs/Dicj11o70KAUAoBQCgFAKAUAoBQCgFAKAUAoBQCgFAKAUAoBQCgFAKAUAoBQCgFAKAUAoBQCgFAKAUB//9k=\",\"mime\":\"image/jpeg\",\"copyright\":{\"license\":\"U\"},\"width\":1199,\"height\":379},\"alt\":\"scuba diver\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"100f149f-9fb5-4955-8ef5-21329854e049\"},{\"params\":{\"text\":\"<p>Karim, a lebanese scuba diver, is searching for exotic fish in the Mediterranean Sea.</p>\\n\\n<p>He consumes 1 liter of oxygen per minute during moderate swimming activity, and his oxygen tank contains 80 liters of oxygen.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"65dfb97a-e40f-41db-a725-11d5639a9f86\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1- Why does Karim need an oxygen tank during diving ?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"515a788c-2624-454d-95cb-fd0860f3945c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2- How long will Karim's oxygen tank last if he swims moderately throughout his diving trip?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"cb213262-d1d7-453b-9672-8fdef28d09ac\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3- Karim saw 10 jellyfishes on his way, so he swam very fast in the other direction. Do you expect the oxygen tank to last as much as if he was swimming moderately?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"0d973d9a-4a06-44f2-9d18-45cc9393602e\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4- Fish are aquatic animals, how do they get oxygen and energy without breathing air?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b8a317a9-07f8-4c80-b19e-63167380dfa7\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Scuba diving\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Scuba diving\"},\"subContentId\":\"a6a7837e-7645-4584-9e76-78671a912342\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1- Karim can't breathe underwater, so he needs an oxygen tank to release the energy stored in his body during diving.</p>\\n\\n<p>2- If he consumes 1 liter of oxygen/minute, he can dive for 80 minutes.</p>\\n\\n<p>3- No, because as he swims faster, he will need more oxygen per minute. This means that the oxygen tank will last less than 80 minutes.</p>\\n\\n<p>4- Fish can get oxygen dissolved in water using their gills. They don't have lungs to inhale oxygen from air.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"465cd97b-b86c-4c30-83a7-aed4e65900df\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard
